import React from 'react';
import EmptyForm from "../../shared/ui/emptyForm/EmptyForm";
import BorderInput from "../../shared/ui/borderInput/BorderInput";
import BlueButton from "../../shared/ui/blueButton/BlueButton";
import {Link} from "react-router-dom";

const Registration = () => {
    return (
        <div>
            <EmptyForm>
                <h1>Регистрация</h1>
                <span className="input-header">ФИО</span>
                <BorderInput type="text" placeholder="Введите свое имя"></BorderInput>

                <span className="input-header">Username</span>
                <BorderInput type="text" placeholder="Введите имя пользователя"></BorderInput>

                <span className="input-header">Password</span>
                <BorderInput type="text" placeholder="Введите пароль"></BorderInput>
                <BorderInput type="text" placeholder="Повторите пароль"></BorderInput>

                <div className="space-between">
                    <Link to="/login">
                        <BlueButton>Уже есть аккаунт?</BlueButton>
                    </Link>
                    <BlueButton>Зарегистрироваться</BlueButton>
                </div>
            </EmptyForm>
        </div>
    );
};

export default Registration;
